raw_question: Of all the contestants who got voted, what is the contestant number and name of the contestant who got least votes? 
question_index: 695 
join_columns:
 - contestant_number
groupby_columns:
 - contestant_number
functions:
 - min
 - count
comment: |-
  SELECT T1.contestant_number,
         T1.contestant_name
  FROM contestants AS T1
  JOIN votes AS T2 ON T1.contestant_number = T2.contestant_number
  GROUP BY T1.contestant_number
  ORDER BY count(*) ASC
  LIMIT 1

sql: |-
  SELECT T1.contestant_number,
         T1.contestant_name
  FROM contestants AS T1
  JOIN votes AS T2 ON T1.contestant_number = T2.contestant_number
  GROUP BY T1.contestant_number
  ORDER BY count(*) ASC
  LIMIT 1
